import { BrowserRouter as Router, Route, R, Switch } from "react-router-dom";
import AdminDashboard from "./AdminDashboard";
import ProductPage from "./ProductPage"; // import your ProductPage component
// import { Switch } from 'react-router-dom';
import { Redirect } from 'react-router-dom';



const App = () => {
  return (
    <Router>
      <Switch>
        <Route path="/product" component={ProductPage} /> {/* ProductPage route */}
        <Route path="/Dashboard" component={AdminDashboard} /> {/* AdminDashboard route */}
        <Redirect to="/product" /> {/* Redirect to ProductPage by default */}
      </Switch>
    </Router>
  );
};

export default App;
